import React from "react";
import gmplogo from "../assets/images/gmplogo.png";

const Header = () => {
  return (
    <header className="header">
      <div className="logo-box">
        <img src={gmplogo} alt="logo" className="logo" />
      </div>

    </header>
  );
};

export default Header;
